CREATE TABLE presidential_ev_probabilities_2020 (
  id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  cycle INT,
  branch VARCHAR(255),
  model VARCHAR(255),
  modeldate VARCHAR(255),
  candidate_inc VARCHAR(255),
  candidate_chal VARCHAR(255),
  evprob_inc FLOAT,
  evprob_chal FLOAT,
  total_ev INT,
  timestamp VARCHAR(255),
  simulations INT
);
